bigString = ''
imagedimensions = 23 * 73
stringlength = len(bigString)

print(f'bitstring length: {stringlength} image dimensions: {imagedimensions}')

bitwidth = 23

chunks = (bigString[bitwidth * i:bitwidth * i + bitwidth] for i in range(83))

chunkybitstrings = (f'0b{s}' for s in chunks)

intchunks = [int(b, 2) for b in chunkybitstrings]

print(intchunks)
